import React from 'react';
import { Link } from 'react-router-dom';
import './main.css'; // This is for custom styles like animations

const Main = () => {
  return (
    <div className="flex justify-around w-[90%] h-full m-0 items-center">
      <Link to='/sc'>
        <button className="relative z-0 flex justify-center items-center text-center w-[250px] h-[200px] bg-transparent border-none outline-none text-white rounded-xl cursor-pointer glow-button text-2xl m-10">
          StandUp Comedy
        </button>
      </Link>
      <Link to='/lc'>
        <button className="relative z-0 flex justify-center items-center text-center w-[250px] h-[200px] bg-transparent border-none outline-none text-white rounded-xl cursor-pointer glow-button text-2xl m-10">
          Live Concerts
        </button>
      </Link>
      <Link to='/ce'>
        <button className="relative z-0 flex justify-center items-center text-center w-[250px] h-[200px] bg-transparent border-none outline-none text-white rounded-xl cursor-pointer glow-button text-2xl m-10">
          Cultural Events
        </button>
      </Link>
      <Link to='/se'>
        <button className="relative z-0 flex justify-center items-center text-center w-[250px] h-[200px] bg-transparent border-none outline-none text-white rounded-xl cursor-pointer glow-button text-2xl m-10">
          Sports Events
        </button>
      </Link>
    </div>
  );
};

export default Main;
